INSERT INTO `berita_kampus` (`id_berita`, `tgl_berita`, `judul_berita`, `jml_like`, `jml_komentar`, `text_berita`) VALUES
(1, '2022-10-10', 'Teten Minta Kampus di Indonesia Contoh Inovasi Kewirausahaan Kampus Luar Negeri', 0, 0, 'Menteri Koperasi dan UKM (MenKopUKM), Teten Masduki mengatakan kampus harus mampu mengevolusi produk dalam negeri dan menghadirkan inovasi kreatif di bidang kewirausahaan yang bermanfaat bagi masyarakat. Teten dalam acara Peresmian Gedung Fakultas Kewirausahaan Universitas Garut, Jawa Barat mengatakan banyak kisah sukses kampus di luar negeri yang dapat menghadirkan inovasi kewirausahaan melalui kampus. Hal ini bisa dijadikan contoh bagi kampus-kampus di Indonesia. \"Saya berharap banyak, salah satunya kepada Universitas Garut. Banyak kampus di luar negeri itu mampu menghadirkan inovasi kewirausahaan. Banyak universitas di luar negeri punya laboratorium inovasi yang dapat mengevolusi produk dalam negeri,\" ucap Teten seperti dikutip dari siaran pers. Ia mengatakan, kehadiran Gedung Fakultas Kewirausahaan Universitas Garut diharapkan dapat berkontribusi untuk mencetak para jagoan wirausaha di Indonesia. Lebih lanjut, Teten menambahkan beberapa negara yang dapat dicontoh ialah Korea Selatan yang mampu membangun industri riset lewat perguruan tingginya sehingga mampu meningkatkan omzet pelaku usaha lebih dari 40 persen. \"Jadi ini (Universitas Garut) kita bisa besarkan menjadi center of excellence untuk mengevolusi kewirausahaan. Karena sekarang itu yang penting bukan produknya, tapi mengembangkan model bisnis termasuk mengembangkan digitalisasi,\" kata Teten. Teten menuturkan Presiden Joko Widodo juga telah memberikan tugas untuk mencetak 1 juta wirausaha mapan baru pada 2024. Hal ini berkaitan dengan persentase kewirausahaan di Indonesia yang baru mencapai 3,47 persen. Dengan mencetak 1 juta wirausaha mapan baru, diharapkan pada 2024 nanti persentase kewirausahaan dapat meningkat menjadi 3,95 persen. \"Bahkan kalau memungkinkan bisa mencapai 4 persen di 2024 nanti,\" katanya. Teten menegaskan, saat ini perguruan tinggi bukan lagi menjadi tempat untuk menjadikan lulusannya menjadi pegawai pemerintah atau swasta karena generasi muda saat ini berkeinginan untuk menjadi wirausaha, bukan lagi hanya menjadi pegawai. \"Dari survei kami, 73 persen dari anak muda ingin jadi pebisnis. Kalau kampus tidak mengubah konsepnya, kampus akan ditinggalkan,\" ucap Menteri Teten. Di tempat yang sama, Bupati Garut Rudy Gunawan berharap kehadiran Universitas Garut dapat menjadi tempat untuk memberdayakan masyarakat nantinya. \"Semoga Universitas Garut bisa ikut memberdayakan masyarakat dan semakin sukses ke depannya,\" ucap Rudy.\r\n'),
(2, '2022-10-10', 'Teten Minta Kampus di Indonesia Contoh Inovasi Kewirausahaan Kampus Luar Negeri', 20, 10, 'Menteri Koperasi dan UKM (MenKopUKM), Teten Masduki mengatakan kampus harus mampu mengevolusi produk dalam negeri dan menghadirkan inovasi kreatif di bidang kewirausahaan yang bermanfaat bagi masyarakat. Teten dalam acara Peresmian Gedung Fakultas Kewirausahaan Universitas Garut, Jawa Barat mengatakan banyak kisah sukses kampus di luar negeri yang dapat menghadirkan inovasi kewirausahaan melalui kampus. Hal ini bisa dijadikan contoh bagi kampus-kampus di Indonesia. \"Saya berharap banyak, salah satunya kepada Universitas Garut. Banyak kampus di luar negeri itu mampu menghadirkan inovasi kewirausahaan. Banyak universitas di luar negeri punya laboratorium inovasi yang dapat mengevolusi produk dalam negeri,\" ucap Teten seperti dikutip dari siaran pers. Ia mengatakan, kehadiran Gedung Fakultas Kewirausahaan Universitas Garut diharapkan dapat berkontribusi untuk mencetak para jagoan wirausaha di Indonesia. Lebih lanjut, Teten menambahkan beberapa negara yang dapat dicontoh ialah Korea Selatan yang mampu membangun industri riset lewat perguruan tingginya sehingga mampu meningkatkan omzet pelaku usaha lebih dari 40 persen. \"Jadi ini (Universitas Garut) kita bisa besarkan menjadi center of excellence untuk mengevolusi kewirausahaan. Karena sekarang itu yang penting bukan produknya, tapi mengembangkan model bisnis termasuk mengembangkan digitalisasi,\" kata Teten. Teten menuturkan Presiden Joko Widodo juga telah memberikan tugas untuk mencetak 1 juta wirausaha mapan baru pada 2024. Hal ini berkaitan dengan persentase kewirausahaan di Indonesia yang baru mencapai 3,47 persen. Dengan mencetak 1 juta wirausaha mapan baru, diharapkan pada 2024 nanti persentase kewirausahaan dapat meningkat menjadi 3,95 persen. \"Bahkan kalau memungkinkan bisa mencapai 4 persen di 2024 nanti,\" katanya. Teten menegaskan, saat ini perguruan tinggi bukan lagi menjadi tempat untuk menjadikan lulusannya menjadi pegawai pemerintah atau swasta karena generasi muda saat ini berkeinginan untuk menjadi wirausaha, bukan lagi hanya menjadi pegawai. \"Dari survei kami, 73 persen dari anak muda ingin jadi pebisnis. Kalau kampus tidak mengubah konsepnya, kampus akan ditinggalkan,\" ucap Menteri Teten. Di tempat yang sama, Bupati Garut Rudy Gunawan berharap kehadiran Universitas Garut dapat menjadi tempat untuk memberdayakan masyarakat nantinya. \"Semoga Universitas Garut bisa ikut memberdayakan masyarakat dan semakin sukses ke depannya,\" ucap Rudy.\r\n');

