(1, 'Arkeologi', 'A', 45, 478, 'arkeologi.ugm.ac.id', 'Mempelajari kebudayaan masyarakat masa lampau dan peninggalan hasil budaya masyarakat masa lampau serta cara merekonstruksi peradaban dan kebudayaannya beserta segenap aspeknya.', 'Arkeolog, dosen, jurnalis, pemandu wisata sejarah, dll', 500000, 7000000, 'Sarjana', 48, 2),
(2, 'Antropologi Budaya', 'A', 100, 724, 'https://antropologi.fib.ugm.ac.id', 'Department of Anthropology Faculty of Cultural Sciences UGM has two study programs (Prodi), namely Prodi S1 Cultural Anthropology, and S2 (Master) Anthropology. The two study programs have integrated curriculum materials, meaning that the curriculum of S1 and S2 Study Programs is a unit. The two curricula are separated because each has different graduate competencies, but as a unit, the S1 curriculum becomes the foundation of the S2 curriculum, and undergraduate graduates have a strong foundation to continue their studies in S2 Study Program.\r\n\r\nThe Department of Anthropology has formulated the core of the Anthropology education curriculum that should be realized in the FIB UGM environment. In essence, the Department of Anthropology manages and develops anthropology in order to produce expertise that is able to find and explain socio-cultural changes faced by humans both in Indonesia and in the world at large. The expertise will be realized as the ethnographic work of the academic community, both those who graduated in S1 and S2. Graduates can produce ethnographic work and can work professionally in the field of cultural management and development.', 'Bidang pengajaran, bisnis, penelitian, korporasi, media, birokrasi, lembaga swadaya masyarakat, organisasi masyarakat, dan kesehatan', 500000, 7000000, 'Sarjana', 46, 2),
(3, 'Teknik Industri', 'A', 350, 800, 'https://teknikindustriuajy.id/', 'Teknik Industri Universitas Atma Jaya Yogyakarta (UAJY) adalah Universitas yang memiliki jenjang S1 dan S2 (Magister) Teknik Industri yang merupakan salah satu Universitas Swasta Katolik terbaik di wilayah Jogja dan Jawa Tengah bahkan di Indonesia.\r\n\r\nSebagai salah satu Universitas Swasta Kristen terbaik di Jogja maupun Indonesia, Teknik Industri Universitas Atma Jaya Yogyakarta berkomitmen teguh untuk menjalankan pengajaran dengan dukungan fasiltas laboratorium Teknik Industri terbaik. Sebagai wujud nyata Teknik Industri Universitas Atma Jaya Yogyakarta dalam menjadi Teknik Industri terbaik di Jogja, pada tahun 2021, Teknik Industri Universitas Atma Jaya Yogyakarta telah mendapatkan akreditasi Internasional IABEE.\r\n\r\nSelain itu Teknik Industri Universitas Atma Jaya Yogyakarta juga di dukung oleh tenaga pengajar yang berkualitas yang merupakan lulusan universitas terbaik di Indonesia maupun di luar negeri.    ', 'pengendalian kualitas, supply chain management, Production Planning and Inventory Control (PPIC), data science, data engineer, human resource, otomasi, kewirausahaan, dan sebagainya.', 500000, 24000000, 'Sarjana', 46, 1);

