(1, 'Universitas Atma Jaya Yogyakarta', 'Babarsari', 'A', 'Swasta', 'PTS', 274487711, 274487748, 'Universitas Atma Jaya Yogyakarta (UAJY) is a private university founded by the laity and managed by Slamet Rijadi Foundation - Yogyakarta, under the patronage of Saint Albertus Magnus. UAJY was established on September 27, 1965, aiming to participate in educating nation through education with a local dimension and global orientation.\r\n\r\nSince August 31, 1973, Atma Jaya Catholic University of Indonesia in Yogyakarta has separated from the Atmajaya Catholic University of Indonesia in Jakarta and been established as the UNIVERSITAS ATMA JAYA YOGYAKARTA.\r\n\r\nThe name of “Atma Jaya” is taken from Sanskrit. Atma means soul, Jaya means superior. Thus, Atma Jaya means a superior soul. UAJY\'s aspiration from the beginning is to provide higher education with excellence in academics and education with high moral values.\r\n\r\nUAJY has 12 regular study programs and 5 international study programs for Bachelor degree, and 7 study programs for Master degree. All study programs have been accredited by BAN-PT (The National Accreditation Board for Higher Education).\r\n\r\nBased on the spirit of Serviens in Lumine Veritatis and the principles of integrity, transparency and accountability, innovation, multiculturalism, openness, sustainability, and siding with the weak, UAJY participates in educating the nation\'s life, forming human beings who are cultured, civilized, high moral, superior and value diversity.\r\n\r\nUAJY advances and disseminates environmentally friendly science and technology that is beneficial to human life participates in efforts to promote public welfare and the creation of world peace, performs works in community empowerment efforts, and is anticipatory and responsive to natural disasters, both nationally and internationally and by keeping in mind the values of Indonesian local wisdom.', 4, 'http://uajy.ac.id', 305, 11897, );
INSERT INTO `list_kampus` (`id_kampus`, `nama_kampus`, `alamat`, `akreditasi`, `jenis_pt`, `status`, `no_telp`, `no_fax`, `profil`, `ranking`, `website`, `jml_dosen`, `jml_mhs`, `foto`) VALUES
(2, 'Universitas Gadjah Mada', 'Bulaksumur Yogyakarta 55281', 'A', 'Negeri', 'PTN', 274649259, 274565223, 'Universitas Gadjah Mada lahir dari kancah perjuangan revolusi kemerdekaan bangsa Indonesia. Didirikan pada periode awal kemerdekaan, UGM didaulat sebagai Balai Nasional Ilmu Pengetahuan dan Kebudayaan bagi penyelenggaraan pendidikan tinggi nasional.\r\n\r\nBerdiri dengan nama “Universitas Negeri Gadjah Mada”, perguruan tinggi ini merupakan gabungan dari beberapa sekolah tinggi yang telah lebih dulu didirikan, di antaranya Balai Perguruan Tinggi Gadjah Mada, Sekolah Tinggi Teknik, dan Akademi Ilmu Politik yang terletak di Yogyakarta, Balai Pendidikan Ahli Hukum di Solo, serta Perguruan Tinggi Kedokteran Bagian Praklinis di Klaten, yang disahkan dengan Peraturan Pemerintah No. 23 Tahun 1949 tentang Peraturan Penggabungan Perguruan Tinggi menjadi Universiteit.', 2, 'https://ugm.ac.id', 2598, 32000, );
INSERT INTO `list_kampus` (`id_kampus`, `nama_kampus`, `alamat`, `akreditasi`, `jenis_pt`, `status`, `no_telp`, `no_fax`, `profil`, `ranking`, `website`, `jml_dosen`, `jml_mhs`, `foto`) VALUES
(3, 'Universitas Achmad Yani Yogyakarta', 'Bulaksumur Yogyakarta 55281', 'B', 'Swasta', 'PTS', 274552489, 274557228, 'Universitas Jenderal Achmad Yani Yogyakarta (UNJAYA) merupakan Perguruan Tinggi dibawah naungan Yayasan Kartika Eka Paksi TNI Angkatan Darat di Yogyakarta dengan Peringkat Akreditasi BAN-PT \"B\" berdasarkan SK Nomor: 394/SK/BAN-PT/Ak-PNB/PT/IX/2019\r\n\r\n(1) Melaksanakan pendidikan yang bermutu dan responsif terhadap kemajuan ilmu dan teknologi.\r\n(2) Melaksanakan kegiatan penelitian yang unggul di bidang ilmu pengetahuan, teknologi, dan budaya bangsa, dan menghasilkan produk-produk inovasi berbasis teknologi.\r\n(3) Melaksanakan pengabdian kepada masyarakat yang berdaya guna dan berhasil guna.\r\n(4) Melakukan kerja sama yang berkelanjutan dengan stakeholder untuk mewujudkan daya saing global.\r\n(5) Menyelenggarakaan dan mengembangkan manajemen yang baik dan mandiri (Good University Governance).\r\n(6) Mendalami dan mengembangkan nilai-nilai kejuangan Jenderal Achmad Yani untuk diterapkan oleh sivitas akademika dan pendukungnya ', 158, 'https://unjaya.ac.id/', 350, 12500, );
INSERT INTO `list_kampus` (`id_kampus`, `nama_kampus`, `alamat`, `akreditasi`, `jenis_pt`, `status`, `no_telp`, `no_fax`, `profil`, `ranking`, `website`, `jml_dosen`, `jml_mhs`, `foto`) VALUES
